graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>start</b></td></tr></table>>, pad=0.5, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "end" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>end</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "a" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>a</b></td></tr></table>>, pad=0.5, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "b" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>b</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "c" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>c</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "d" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>d</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "start" -> "end" [labelOverlay="75%", edgeURL="#L1:6-1:12"];
  "a" -> "b" [labelOverlay="75%", edgeURL="#L2:2-2:12"];
  "a" -> "c" [labelOverlay="75%", edgeURL="#L2:2-2:12"];
  "a" -> "d" [labelOverlay="75%", edgeURL="#L2:2-2:12"];
  "a" -> "b" [labelOverlay="75%", edgeURL="#L3:2-3:6"];
  "b" -> "c" [labelOverlay="75%", edgeURL="#L3:7-3:11"];
  "c" -> "d" [labelOverlay="75%", edgeURL="#L3:12-3:16"];
  "a" -> "b" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>label</b></td></tr></table>>, labelOverlay="75%", edgeURL="#L5:2-5:12"];
  "a" -> "b" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left"><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">condition</td><td align="left" balign="left">true</td></tr></table></td></tr></table>>, labelOverlay="75%", edgeURL="#L6:2-6:22", condition="true"];
  "a" -> "b" [style="dashed", labelOverlay="75%", edgeURL="#L7:2-7:7"];
  "a" -> "b" [penwidth=3, color="#D32F2F", labelOverlay="75%", edgeURL="#L8:2-8:6"];
}
